pub enum Cw20ExecuteMsg {
    Transfer {
            recipient: String,
            amount: Uint128,
        },
    Burn {
            amount: Uint128,
        },
    Send {
            contract: String,
            amount: Uint128,
            msg: Binary,
        },
    IncreaseAllowance {
            spender: String,
            amount: Uint128,
            expires: Option<Expiration>,
        },
    DecreaseAllowance {
            spender: String,
            amount: Uint128,
            expires: Option<Expiration>,
        },
    TransferFrom {
            owner: String,
            recipient: String,
            amount: Uint128,
        },
    SendFrom {
            owner: String,
            contract: String,
            amount: Uint128,
            msg: Binary,
        },
    BurnFrom {
            owner: String,
            amount: Uint128,
        },
    Mint {
            recipient: String,
            amount: Uint128,
        },
    UpdateMarketing {
            project: Option<String>,
            description: Option<String>,
            marketing: Option<String>,
        },
    UploadLogo(Logo),
}

pub enum Cw20QueryMsg {
    Balance {
            address: String,
        },
    TokenInfo {
        },
    Allowance {
            owner: String,
            spender: String,
        },
    Minter {
        },
    MarketingInfo {
        },
    DownloadLogo {
        },
    AllAllowances {
            owner: String,
            start_after: Option<String>,
            limit: Option<u32>,
        },
    AllAccounts {
            start_after: Option<String>,
            limit: Option<u32>,
        },
}
